const persona = {
    nombre: 'Tony',
    apellido: 'Stark',
    edad: 45,
    direccion: {
        ciudad: 'New York',
        zip: '5555',
        lat: '15.54545',
        long: '13.5558',
    }
};


// console.table({ persona });


const persona2 = new persona;

persona2.nombre = 'Peter';

console.log(persona);
console.log(persona2);
